import Link from 'next/link';
import ItemStyled from './styles/ItemStyles';
import Title from './styles/Title';

const Product = ({ product }) => {
  return (
    <ItemStyled>
      <img
        src={product?.photo?.image?.publicUrlTransformed}
        alt={product.name}
      />
      <Title></Title>
    </ItemStyled>
  );
};

export default Product;
